						contentString		 += "<a href=\"" + obj.gmi_url + "\" target=\"_blank\">more...></a>";
					contentString		 += "</"+"div>";
					infowindow		 = new google.maps.InfoWindow({
						content: contentString
					});
					infowindow.setOptions({maxWidth:300});
					return infowindow;
				}

				function markerAtPoint(latlng) {
					for (var i = 0; i < marker_locations_GVSaa2.length; ++i) {
						if (marker_locations_GVSaa2[i].equals(latlng)) return true;
					}
					return false;
				}

				function initialize_GVSaa2() {
					var gmap_zoom	= parseInt("12");
					var gmap_lat	= "";
					var gmap_long	= "";
					var gmap_type	= google.maps.MapTypeId.TERRAIN;
