						suppressMarkers: true
					}
					var directionsDisplay_GVSaa2 = new google.maps.DirectionsRenderer(rendererOptions_GVSaa2);
					directionsDisplay_GVSaa2.setMap(map_GVSaa2);

					// Check has directions
					$( "#pb-gmap-wrapper-GVSaa2 .pb-gmi-lat-long" ).each(function (index) {
						var obj = JSON.parse($(this).val());
						if ( obj.gmi_lat != "" && obj.gmi_long != "" && obj.gmi_destination != "" ) {
							has_direction = true;
						}
					});

					// Add markers
					if ( has_direction == false ) {
						$( "#pb-gmap-wrapper-GVSaa2 .pb-gmi-lat-long" ).each(function (index) {
							var obj = JSON.parse($(this).val());
							if ( obj.gmi_lat != "" && obj.gmi_long != "" ) {
								var myLatlng	 = get_latlong(obj);
								var infowindow	 = get_infobox(obj);
								if ( map_GVSaa2 ) {
									var marker		= new google.maps.Marker({
										position: myLatlng,
										map: map_GVSaa2,
										title: obj.gmi_title
									});
									marker_locations_GVSaa2.push(myLatlng);
									map_GVSaa2.setCenter(marker.getPosition());
									google.maps.event.addListener(marker, 'click', function() {
										infowindow.open(map_GVSaa2,marker);
									});
								}
							}
						});
					} else {

						$( "#pb-gmap-wrapper-GVSaa2 .pb-gmi-lat-long" ).each(function (i) {
							var obj = JSON.parse($(this).val());
							$( "#pb-gmap-wrapper-GVSaa2 .pb-gmi-lat-long" ).each(function (j) {
								var sub_obj	 = JSON.parse($(this).val());

								if ( sub_obj.gmi_title == obj.gmi_destination && sub_obj.gmi_lat != "" && sub_obj.gmi_long != "" ) {
