									var end			 = get_latlong(sub_obj);

									var infowindow	 = get_infobox(obj);
									if ( map_GVSaa2 ) {
										var marker			 = new google.maps.Marker({
											position: start,
											map: map_GVSaa2,
											title: obj.gmi_title
										});
										marker_locations_GVSaa2.push(start);
										google.maps.event.addListener(marker, 'click', function() {
											infowindow.open(map_GVSaa2,marker);
										});
									}

									var sub_infowindow	 = get_infobox(sub_obj);
									if ( map_GVSaa2 ) {
										var sub_marker		 = new google.maps.Marker({
											position: end,
											map: map_GVSaa2,
											title: sub_obj.gmi_title
										});
										marker_locations_GVSaa2.push(end);
										google.maps.event.addListener(sub_marker, 'click', function() {
											sub_infowindow.open(map_GVSaa2,sub_marker);
										});
									}

									var request = {
										origin:start,
										destination:end,
										travelMode: google.maps.DirectionsTravelMode.DRIVING
									};

									directionsService_GVSaa2.route(request, function(response, status) {
										if (status == google.maps.DirectionsStatus.OK) {
											directionsDisplay_GVSaa2.setDirections(response);
										}
									});
								}

